<p>100% natural and organic quality, the organic carrot maceration oil is known to facilitate and prolong the tanning. This oily carrot macerate, brings good looks and illuminates the complexion. After exposure to the sun, this carrot oil helps to keep and standardize the tanning of your complexion. For mature skin, it delays aging skin, thanks to its softening and regenerating properties.</p>
<p><strong> Botanical name: </strong>Daucus Carota</p>
<p><strong> Obtaining method: </strong>This oil is obtained by solar maceration of carrots (daucus carota), in 100% organic sunflower oil.</p>
<p><strong>Organoleptic properties:</strong> Most of the time, clear liquid, orange</p>
<p><strong> Olfactory notes: </strong>Light odor</p>
<p><strong> Aromatherapy properties:</strong> Dyed tarnished, tired, asphyxiated, withered skin, tired, wrinkled (necklines, faces and hands), skins lacking vitality, facilitates tanning, regenerating, softening, softening.</p>
<p><strong> Directions for use: </strong>Apply as bronzing oil, mask after sun or daily for a tan complexion.<br /><strong>(Only for external use)</strong></p>
<p><strong> Composition: </strong>100% of ingredients of natural origin. 100% of the total ingredients are from organic farming. Paraben free, perfume free, phenoxyethanol free, phthalate free.</p>
<p><strong> Ingredients: </strong>HELIANTHUS ANNUS SEED OIL *,  DAUCUS CAROTA ROOT EXTRACT*</p>
<p>* Ingredients from organic farming.</p>
